import { Box } from "@material-ui/core";

const Profile = () => {
  return (
    <Box m={5}>
      <TextField
        autoFocus
        variant="outlined"
        margin="normal"
        id="address"
        label="Address"
        type="text"
        fullWidth
      />
    </Box>
  );
};

export default Profile;
